import React from "react";
import "./SearchBar.css"
import icon from "../assets/search-icon.png"
function SearchBar() {
    handleIconClick = () => {
       alert("hello")
      };
    return (
    <div className="searchbar-container">
        <div className="searchbar-input">
        <input type="text" className="searchbar-input-text" placeholder="search by company name" />
        </div>
        <div className="searchbar-icon" onClick={this.handleIconClick}>
          <img src={icon} alt="search-icon" width={30} height={30} />
        </div>
    </div>);
}

export default SearchBar;
